import React from 'react'
import './header.css'
import { Transition } from "react-transition-group";

const AComponent = ({ in: inProp }) => (
    <Transition in={inProp} timeout={500}>
      {state => (
        <div>
          I am {state}
        </div>
      )}
    </Transition>
  ); 

const Header = ({  headerToggle, headerButtonPressed  }) => {

    return (
        <div>
            <AComponent in={headerToggle} />
            <ul>

                <li><button onClick={() => headerButtonPressed(!headerToggle)}>About</button></li>
                <li><button onClick={() => headerButtonPressed(!headerToggle)}>Projects</button></li>
                <li><button onClick={() => headerButtonPressed(!headerToggle)}>Contact</button></li>

            </ul>
        </div>
    )
}

export default Header
